// src/components/AdminLinks.js
import React from 'react';
import { Link } from 'react-router-dom';

const AdminLinks = () => {
  return (
    <div>
      <h2>Admin Pages</h2>
      <ul>
        <li><Link to="/admin">Sections Upload page</Link></li>
        <li><Link to="/adminmsg">User Message Page</Link></li>
        <li><Link to="/avbadmin">Avb Admin Page</Link></li>
        <li><Link to="/adminfiles">Admin files</Link></li>
        
        {/* Add more links as needed */}
      </ul>
    </div>
  );
};

export default AdminLinks;
